import React from "react";

export default function QuickMenuComponent(){
    return(
        <div id="quickMenu">
            <ul>
                <li><a href="!#"><img src="./img/deliveryInfo.webp" alt=""/></a></li>
                <li><a href="!#">등급별혜택</a></li>
                <li><a href="!#">레시피</a></li>
            </ul>
        </div>
    )
}
